/** @format */

import React from "react";
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";
import Comman from "./Comman";
const About = () => {
  return (
    <>
      <Navbar />
      <Comman h1="Welcome to About page of" />
      <Footer />
    </>
  );
};
export default About;
